function afficherReponse(message) {
    var options = { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' };
    var date = new Date();
    $("#reponses").append("<tr>"    + "<td><img width=100 height=75 src='" +  message.de    + "'/></td>" +
        "<td>" + date.toLocaleDateString('fr-FR',options) + " " + date.toLocaleTimeString() + "</td>" +
        "<td>" + message.status + ": " + message.texte + "</td>" +
        "</tr>");
}

function afficherSpectateurs() {
    clearSpecComp(true);
    for(var i =1;i<=spectateurs.length;i++){
        if($('#spec' + i).attr('value') == "vide") {
            spectateursSavedPosition.set(spectateurs[i-1].avatar,i);
            $('#spec' + i).attr('src', spectateurs[i-1].avatar);
            $('#spec' + i).attr('value',"avatar");
        }
    }
}

function afficherCompetiteurs() {
    clearSpecComp(false);
    for(var i =1;i<=competiteurs.length;i++){
        if($('#comp' + i).attr('value') == "vide") {
            competiteursSavedPosition.set(competiteurs[i-1].avatar,i);
            $('#comp' + i).attr('src', competiteurs[i-1].avatar);
            $('#comp' + i).attr('value',"avatar");
        }
    }
}

function commencerCombat(){
    if(competiteurs.length >= 2 && arbitres.length >= 1){//Il y a assez de monde pour un combat
        //Initier le combat
            //Enlever les 2 compétiteurs et les mettres combattants
        combattants.push(competiteurs[0]);
        combattantsSavedPosition.set(competiteurs[0],0);
        combattants.push(competiteurs[1]);
        combattantsSavedPosition.set(competiteurs[1],1);
        competiteurs.splice(0,2);
            //Enlever les combattant de la liste d'attente
        for(var i = 0;i<2;i++){
            if(competiteursSavedPosition.get(combattants[i].avatar) != null){
                $('#comp' + competiteursSavedPosition.get(combattants[i].avatar)).attr('value',"vide");
                $('#comp' + competiteursSavedPosition.get(combattants[i].avatar)).attr('src',"data:image/png;base64,");

            }
        }

        //Mettre les combattants et arbitre dans la zone de combat
        $('#combat1').attr('value',"avatar");
        $('#combat1').attr('src',combattants[0].avatar);
        //$('#combatTxt1').val();
        $('#combat11').attr('value',"avatar");
        $('#combat11').attr('src',combattants[1].avatar);
        $('#combat6').attr('value',"avatar");
        $('#combat6').attr('src',arbitres[0].avatar);

        $('#btnAction').show();
    }
}

function actionClick(avatar){
    var btnActionValue = $('#btnAction').val();
    switch(btnActionValue){
        case "Rei!":
            var position = combattantsSavedPosition.get(avatar);
            if(position == 0){
                $('#combat1').attr('value',"vide");
                $('#combat1').attr('src',avatarDefault);
                $('#combat2').attr('value',"avatar");
                $('#combat2').attr('src',combattants[0].avatar);
            }
            break;
    }
}

function clearSpecComp(bool){
    for(var i =1;i<=12;i++){
        if(bool==true) {
            $('#spec' + i).attr('value', "vide");
            $('#spec' + i).attr('src', "data:image/png;base64,");
        }else {
            $('#comp' + i).attr('value', "vide");
            $('#comp' + i).attr('src', "data:image/png;base64,");
        }
    }
}

function afficherMinMaxDelta()
{
    $("#mindelta").val(minDelta);
    $("#maxdelta").val(maxDelta);
}

